import Aux from '../../hoc/Aux';
import classes from './Layout.modules.css';

const layout = (props) => (
    <Aux>
        <div>Toolbar, Sidedraw, Backdrop </div>
        <main className={classes.content}>
            {props.children}
        </main>
    </Aux>
);

export default layout;
